svg.script:
var currency = document.getElementById('currency');
var layers = Array.from(currency.children);
var currentLayerIndex = 0;
function hideLayer(layer) {
    var path = layer.querySelector('path');
    path.style.fillOpacity = 0;
    path.style.fillRule = 'nonzero';
}
function showLayer(layer) {
    var path = layer.querySelector('path');
    path.style.fill = 'rgb(2,2,2)';
    path.style.fillOpacity = 100;
    path.style.fillRule = 'nonzero';
}
// Initially hide all layers except the first one
layers.forEach((layer, index) => {
    if (index !== currentLayerIndex) {
        hideLayer(layer);
    } else {
        showLayer(layer);
    }
});
// Select all elements with the class "bills"
var clickableAreas = document.querySelectorAll('.bills');
// Add click event listener to each clickable area
clickableAreas.forEach(function(area) {
    area.addEventListener('click', function() {
        // Hide current layer
        hideLayer(layers[currentLayerIndex]);
        // Move to next layer
        currentLayerIndex = (currentLayerIndex + 1) % layers.length;
        // Show next layer
        showLayer(layers[currentLayerIndex]);
    });
});

function addClickListener(triggerId, targetId) {
    var trigger = document.getElementById(triggerId);
    var target = document.getElementById(targetId);

    trigger.addEventListener('click', function(event) {
        // Stop event propagation
        event.stopPropagation();

        // Check if the target is visible
        var group = target.querySelector('g');
        var isVisible = group.style.opacity == 1;

        // Toggle visibility
        if (isVisible) {
            group.style.opacity = 0;
        } else {
            group.style.opacity = 1;
        }
    });
}
// Usage:
addClickListener('RSMC-text', 'PEPE');

var svg = document.querySelector('svg');
var backgroundWhite = document.getElementById('background-white');

svg.addEventListener('dblclick', function(event) {
    // Check if the clicked element is not one of the 'bills', 'PEPE', or 'RSMC-text' layers
    if (!event.target.closest('.bills') && event.target.id !== 'PEPE' && event.target.id !== 'RSMC-text') {
        // Check if the 'background-white' layer is visible
        var isVisible = backgroundWhite.style.opacity == 1;

        // Toggle visibility
        if (isVisible) {
            backgroundWhite.style.opacity = 0;
        } else {
            backgroundWhite.style.opacity = 1;
        }
    }
});
